import QuoteList from "../quotes/QuoteList";

const DUMMY_QUOTES = [
  {
    id: "q1",
    author: "Chitrakannan",
    text: "Learning React is fun",
  },
  {
    id: "q2",
    author: "Dhruva",
    text: "Learning React is not fun",
  },
];

const AllQuotes = () => {
  return <QuoteList quotes={DUMMY_QUOTES} />;
};

export default AllQuotes;
